import React from 'react';

export default function CharacterFiltersApplied(props) {
    const {filters} = props;

    return (
        <div>
            {
                Object.keys(filters || {}).forEach(filter => (
                    (filters[filter] || []).map(filter => <span>{filter}</span>)
                ))
            }
        </div>
    );
}
